import React from "react"

const Blackout = () => {
    const divStyle = {
        
        padding: '2em',
        width: '100%',
        backgroundColor: 'black',
        position: 'fixed',
    };
    return (
        <div 
            style={divStyle}
            className="blackOut" 
            id="blackOutScreen">
        </div>
    )
} 

export default Blackout
